pragma solidity 0.5.1;

import "./Staker.sol";
import "./Utils/SafeMath.sol";


contract StakeManager is Staker {
    using SafeMath for uint256;

    bytes32 private agenda; // only support single proposal
    uint256 private period;
    uint256 private scores;
    uint256 private wasted;
    uint256 private border;

    mapping(address => bool) private swc;

    event DepositEvent(address _who, uint256 _amount);
    event SubmittedProposal(bool join, address who, uint256 period);
    event Voted(address sender, bool vote, uint256 total);

    address[] private voted;

    modifier isNotVoting() {
        require(agenda == 0x0);
        _;
    }

    constructor(address _gov, uint256 _shares, uint256 _wasted) public {
        setup(_gov, _shares);
        wasted = _wasted * 10 ** uint256(getDecimals());
    }

    // add or sub members to witness / lender
    function submitAgenda(bool _join, address _who, uint256 _period) public returns (bool) {
        require(agenda == 0x0, "agenda is submitted");
        require(_period >= block.timestamp + 7 days, "_period < block.timestamp + 7 days");
        require(_period <= block.timestamp + 14 days, "_period >= block.timestamp + 14 days");
        spend(wasted);
        agenda = keccak256(abi.encodePacked(_join, _who, _period, msg.sender));
        scores = getTotalSupply(); // init vote score min totalsuppy of tokens.
        border = scores;
        period = _period;
        emit SubmittedProposal(_join, _who, _period);
        return true;
    }

    function vote(bool _vote) public returns (bool) {
        require(agenda != 0x0, "agenda is not saved");
        require(!isVoted(msg.sender), "msg.sender already submitted");
        uint256 stakes = getStake(getLink(msg.sender));
        if (_vote) {
            scores = scores.add(stakes);
        } else {
            scores = scores.sub(stakes);
        }
        voted.push(msg.sender);
        _slice(getLink(msg.sender), wasted);
        emit Voted(msg.sender, _vote, scores);
        return true;
    }

    function close(
        bool _join, 
        address _who, 
        uint256 _period, 
        address _sender
    ) public returns (bool) {
        bytes32 hash = keccak256(abi.encodePacked(_join, _who, _period, _sender));
        require(hash == agenda, "proposal hash is not correct");
        require(block.timestamp >= _period);
        // vote success
        if (scores > border) { // agreed
            swc[_who] = true;
        } else {
            swc[_who] = false;
        }
        delete voted;
        agenda = 0x0; // reset proposal
        scores = 0;
        return true;
    }

    function resign(address _who) public isNotVoting returns (bool) {
        if (isSWCOwner(msg.sender)) {
            return false;
        }
        return super.resign(_who);
    }

    function getScore() public view returns (uint256) {
        return scores;
    }

    function getPeriod() public view returns (uint256) {
        return period;
    }

    function isSWC(address _who) public view returns (bool) {
        return swc[_who];
    }

    function isSWCOwner(address _who) internal view returns (bool) {
        // if registerd swc
        if (isSWC(_who)) {
            // if who is linked by msg.sender
            if (getLink(_who) == msg.sender) {
                return true;
            }
        }
        return false;
    }

    function isVoted(address _who) internal view returns (bool) {
        bool result = false;
        if (voted.length == 0) {
            return result;
        }
        for (uint i = 0; i < voted.length - 1; i++) {
            if (voted[i] == _who) {
                result = true;
            }
        }
        return result;
    }
}
